 "Change the styling:": "Cambia la presentaci\u00f3n:", 
 "<p>DropDown exercises are texts or sentences where students must select the correct words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Los ejercicios en los que se usa la Actividad desplegable son textos u oraciones donde los estudiantes deben elegir las palabras correctas. Este tipo de ejercicios se usa a menudo con los siguientes objetivos:<\/p><ol><li>Para comprobar los conocimientos de los conceptos clave de un curso (podr\u00eda tratarse de un control previo, una prueba formativa o una prueba sumativa).<\/li><li>Para comprobar la comprensi\u00f3n lectora.<\/li><li>Para comprobar el conocimiento de vocabulario.<\/li><li>Para comprobar la competencia morfol\u00f3gica o gramatical. <\/li><\/ol>", 
 "Example rubrics": "R\u00fabricas de ejemplo", 
 "Enter the details of the reading including reference details. The \nreferencing style used will depend on the preference of your faculty or \ndepartment.": "Introduzca los detalles de la lectura incluyendo las referencias. El \nestilo de referencia usada depender\u00e1 de las preferencias que tenga su facultad \no departamento.", 
