 "Time to answer(seconds)": "Tiempo para responder (en segundos)", 
 "Quotation is an iDevice that provides the students with quotations to reflect upon.": "Citas para pensar es un iDevice que permite al alumnado reflexionar sobre algunas citas propuestas.", 
 "The majority of a learning resource will be \nestablishing context, delivering instructions and providing general information.\nThis provides the framework within which the learning activities are built and \ndelivered.": "La mayor parte de un recurso de ense\u00f1anza ser\u00e1\nestablecer el contexto, dar instrucciones y proporcionar informaci\u00f3n general. \nEste proporciona el esquema dentro del cual las actividades del aprendizaje son construidas\ny proporcionadas.", 
 "SAVE FAILED!": "\u00a1ERROR AL GUARDAR!", 
 "Failed to save properties": "Error al guardar las propiedades", 
 "Unlink": "Quitar hiperv\u00ednculo", 
 "Add all the files provided for the applet\nexcept the .txt file one at a time using the add files and upload buttons. The \nfiles, once loaded will be displayed beneath the Applet code field.": "A\u00f1ada todos los archivos que necesita el applet\nexcepto el archivo .txt uno a uno, usando los botones A\u00f1adir archivos y Cargar. Una vez \ncargados, los archivos aparecer\u00e1n debajo del campo C\u00f3digo del applet.", 
 "<p>The Wikipedia iDevice allows you to locate \nexisting content from within Wikipedia and download this content into your eXe \nresource. The Wikipedia Article iDevice takes a snapshot copy of the article \ncontent. Changes in Wikipedia will not automatically update individual snapshot \ncopies in eXe, a fresh copy of the article will need to be taken. Likewise, \nchanges made in eXe will not be updated in Wikipedia. <\/p> <p>Wikipedia content \nis covered by the GNU Free Documentation 1.2 License, and since 2009 additionally\nby the Creative Commons Attribution-ShareAlike 3.0 Unported License.<\/p>": "<p>El iDevice Wikipedia le permite buscar \ncontenido existente en la Wikipedia y descargar este contenido en su recurso eXe. \nEl iDevice Art\u00edculo de la wikipedia lo que hace es una copia del contenido del \n art\u00edculo; los cambios posteriores que se produzcan en la Wikipedia no se reflejar\u00e1n autom\u00e1ticamente en la copia \n del art\u00edculo en eXe, ser\u00e1 necesario realizar una nueva copia. As\u00ed mismo, \nlos cambios realizados en eXe no producir\u00e1n efectos en los art\u00edculos de la Wikipedia. <\/p> <p>El Contenido de la Wikipedia \nesta protegido por la Licencia de documentaci\u00f3n libre de GNU 1.2, y desde 2009 adem\u00e1s\npor la licencia CreativeCommons Reconocimiento-compartir igual 3.0 Unported.<\/p>", 
