 "eXeLearning, the EXtremely Easy to use eLearning authoring tool\n   Usage: %s [OPTION] [PACKAGE]\n  -V, --version    print version information and exit\n  -h, --help       display this help and exit\n  --standalone     Run totally from current directory\n  --portable       Run in portable mode\nSettings are read from exe.conf in $HOME\/.exe on Linux\/Unix\/Mac OS or\nin Documents and Settings\/<user name>\/Application Data\/exe on Windows XP or\nUsers\/<user name>\/AppData\/Roaming\/exe on Windows 7": "eXeLearning, la EXtremadamente f\u00e1cil de usar herramienta de autor\u00eda Educativa \n    Uso: %s [OPCI\u00d3N] [PAQUETE]\n    -V, --version   imprimir la versi\u00f3n y salir\n    -h, --help      mostrar este texto de ayuda y salir\n    --standalone    Ejecutar totalmente desde el directorio actual\n    --portable      Ejecutar en modo portable\nLa configuraci\u00f3n se lee del exe.conf presente en $HOME\/.exe en GNU Linux\/Unix\/Mac,\nen Documents and Settings\/<user name>\/Application Data\/exe en Windows XPo en\nUsuarios\/<user name>\/AppData\/Roaming\/exe en Windows 7", 
 "creative commons: attribution - non derived work - non commercial 2.5": "Creative Commons: Reconocimiento - sin obra derivada - no comercial 2.5", 
 "Although more often used in formal testing \nsituations MCQs can be used as a testing tool to stimulate thought and  \ndiscussion on topics students may feel a little reticent in responding to. \n\nWhen designing a MCQ test consider the following:\n<ul>\n<li> What learning outcomes are the questions testing<\/li>\n<li>    What intellectual skills are being tested<\/li>\n<li> What are the language skills of the audience<\/li>\n<li> Gender and cultural issues<\/li>\n<li> Avoid grammar language and question structures that might provide \n     clues<\/li>\n<\/ul>\n ": "Aunque es usado m\u00e1s a menudo en situaciones de pruebas formales, las preguntas \nde selecci\u00f3n m\u00faltiple (MCQ) pueden ser usadas como una herramienta de evaluaci\u00f3n que estimula el pensamiento \ny la discusi\u00f3n sobre temas donde los estudiantes pueden sentirse un poco reticentes a responder. \n\nCuando dise\u00f1e una pregunta de elecci\u00f3n m\u00faltiple considere lo siguiente:\n<ul>\n<li>Qu\u00e9 resultados del aprendizaje eval\u00faan las preguntas<\/li>\n<li>Qu\u00e9 habilidades intelectuales est\u00e9n siendo evaluadas<\/li>\n<li>Cu\u00e1les son las destrezas ling\u00fc\u00edsticas de los destinatarios<\/li>\n<li>Cuestiones de g\u00e9nero y culturales<\/li>\n<li>Evite lenguaje gramatical y estructura de preguntas que podr\u00edan contener \n      pistas<\/li>\n<\/ul>\n ", 
