 "A case study is a device that provides learners \nwith a simulation that has an educational basis. It takes a situation, generally \nbased in reality, and asks learners to demonstrate or describe what action they \nwould take to complete a task or resolve a situation. The case study allows \nlearners apply their own knowledge and experience to completing the tasks \nassigned. when designing a case study consider the following:<ul> \n<li>\tWhat educational points are conveyed in the story<\/li>\n<li>\tWhat preparation will the learners need to do prior to working on the \ncase study<\/li>\n<li>\tWhere the case study fits into the rest of the course<\/li>\n<li>\tHow the learners will interact with the materials and each other e.g.\nif run in a classroom situation can teams be setup to work on different aspects\nof the case and if so how are ideas feed back to the class<\/li><\/ul>": "Un caso pr\u00e1ctico es un iDevice que presenta a los estudiantes \nuna simulaci\u00f3n que tiene una base educativa. Parte de una situaci\u00f3n, generalmente \nbasada en la realidad, y pide a los estudiantes que demuestren o describan qu\u00e9 acci\u00f3n \nllevar\u00edan a cabo para completar la tarea o resolver la situaci\u00f3n. El caso pr\u00e1ctico permite \na los estudiantes aplicar sus conocimientos y experiencia propios para completar las tareas \nasignadas. Cuando dise\u00f1e un caso pr\u00e1ctico considere lo siguiente:<ul> \n<li>\tQu\u00e9 puntos educativos estar\u00e1n presentes en la historia<\/li>\n<li>\tQu\u00e9 preparaci\u00f3n necesitar\u00e1n hacer los estudiantes antes de trabajar en \nel caso pr\u00e1ctico<\/li>\n<li>\tD\u00f3nde encaja el caso pr\u00e1ctico dentro del resto del curso<\/li>\n<li>\tC\u00f3mo actuar\u00e1n rec\u00edprocamente los estudiantes con los materiales y entre ellos\n ej.: caso de realizarse en el aula, si pueden organizarse equipos para que \ntrabajen en diferentes aspectos del caso y, de ser as\u00ed, c\u00f3mo se hacen llegar las ideas al resto de la clase<\/li><\/ul>", 
