 "very easy": "muy f\u00e1cil", 
 "\n        <h2>Click The Elements in Order Game<\/h2>\n        <p>\n                This builds a Javascript game where the player has to click on a certain place on the main area according to the hint.  \n                When they click correctly the positive feedback will come and the game will advance.  When they click the wrong\n                area negative feedback will be shown.  When they click on the correct area an item can be revealed there.  A delay\n                can be set to make the item disappear if desired after a delay.\n        <\/p>\n\n        ": "\n<h2>Juego Haz clic en los elementos por orden<\/h2>\n<p>\nEste iDevice construye un juego en javascript en el que el jugador tiene que hacer clic en un sitio determinado del \u00e1rea principal seg\u00fan la ayuda. \nCuando se hace clic correctamente aparecer\u00e1 una retroalimentaci\u00f3n positiva y se avanzar\u00e1 en el juego. Cuando se hace clic en el \u00e1rea\nequivocada, se mostrar\u00e1 retroalimentaci\u00f3n negativa. Cuando se pulsa en el \u00e1rea correcta podr\u00e1 descubrirse un objeto. Puede fijarse un retraso\nque haga que si as\u00ed se desea el objeto desaparezca tras ese retraso.\n <\/p>\n\n          ", 
