 "Table Properties": "Propiedades de la tabla", 
 "<p>\nThe image with text iDevice can be used in a number of ways to support both\nthe emotional (affective) and learning task (cognitive) dimensions of eXe\ncontent. \n<\/p><p>\n<b>Integrating visuals with verbal summaries<\/b>\n<\/p><p>\nCognitive psychologists indicate that presenting learners with a\nrepresentative image and corresponding verbal summary (that is presented\nsimultaneously) can reduce cognitive load and enhance learning retention.\nThis iDevice can be used to present an image (photograph, diagram or\ngraphic) with a brief verbal summary covering the main points relating to\nthe image. For example, if you were teaching the functions of a four-stroke\ncombustion engine, you could have a visual for each of the four positions of\nthe piston with a brief textual summary of the key aspects of each visual.\n<\/p>": "<p>\nEl iDevice &lt;Imagen con texto&gt; puede  utilizarse de varias maneras para\napoyar las dos dimensiones de contenido eXe: la emocional (afectiva) y la de\nactividad de aprendizaje (cognitiva)\n <\/p><p>\n<b>Integraci\u00f3n de elementos visuales con res\u00famenes verbales<\/b>\n<\/p><p>\nLos psic\u00f3logos cognitivos indican que presentar a los alumnos una imagen\nrepresentativa y un resumen verbal (presentado simult\u00e1neamente), puede\nreducir la carga cognitiva y aumentar la retenci\u00f3n de aprendizaje. Este\niDevice puede usarse para presentar una imagen (foto, diagrama o gr\u00e1fico)\ncon un breve resumen verbal que cubra los puntos principales relativos a la\nimagen. Por ejemplo, si estuviera explicando las funciones de un motor de\ncombusti\u00f3n de cuatro tiempos, podr\u00eda tener una representaci\u00f3n visual de cada una de las posiciones del\npist\u00f3n con un breve resumen verbal de los aspectos clave de cada imagen.\n<\/p>", 
 "Please don't forget to write the file size.": "No olvide escribir el tama\u00f1o del fichero.", 
 "Package exported to <a href=\"%s\" target=\"_blank\" title=\"Click to view the exported package\">%s<\/a>.": "Paquete exportado a  <a href=\"%s\" target=\"_blank\" title=\"Pulse para ver el paquete exportado\">%s<\/a>.", 
 "Creative Commons Attribution Non-commercial No Derivatives License 2.5": "Licencia Creative Commons Reconocimiento No comercial Sin obra derivada 2.5", 
 "Provide a caption for the flash you \n                                  have just inserted.": "Proporcione un t\u00edtulo para el archivo flash\n                                     que acaba de insertar.", 
 "<p>Cloze exercises are texts or sentences where students must fill in missing words. They are often used for the following purposes:<\/p><ol><li>To check knowledge of core course concepts (this could be a pre-check, formative exercise, or summative check).<\/li><li>To check reading comprehension.<\/li><li>To check vocabulary knowledge.<\/li><li>To check word formation and\/or grammatical competence. <\/li><\/ol>": "<p>Los ejercicios de rellenar huecos consisten en textos u oraciones donde los estudiantes deben completar las palabras que faltan. Este tipo de ejercicios se usa para diversos fines:<\/p><ol><li>Para comprobar los conocimientos de los conceptos clave de un curso (podr\u00eda tratarse de un control previo, una prueba formativa o una prueba sumativa).<\/li><li>Para comprobar la comprensi\u00f3n lectora.<\/li><li>Para comprobar el conocimiento de vocabulario.<\/li><li>Para comprobar la competencia morfol\u00f3gica o gramatical.<\/li><\/ol>", 
